(function () {
    "use strict";

    document.addEventListener("deviceready", onDeviceReady.bind(this), false);

    function onDeviceReady() {

        // Handle the Cordova pause and resume events
        document.addEventListener("pause", onPause.bind(this), false);
        document.addEventListener("resume", onResume.bind(this), false);

        // TODO: Cordova has been loaded. Perform any initialization that requires Cordova here.
    }

    function onPause() {
        // TODO: This application has been suspended. Save application state here.
    }

    function onResume() {
        // TODO: This application has been reactivated. Restore application state here.
    }


    var app = angular.module("AppModule", ["ngMaterial", "ngAria", "ngAnimate", 'ngMessages', 'ui.router'])
            .config(function ($mdThemingProvider, $locationProvider, $compileProvider, $stateProvider, $urlRouterProvider, $logProvider) {

                $logProvider.debugEnabled(false);
                $compileProvider.debugInfoEnabled(false);
                $compileProvider.commentDirectivesEnabled(false);
                $compileProvider.cssClassDirectivesEnabled(false);

                $mdThemingProvider.theme('default')
                .primaryPalette("blue")
                .accentPalette("light-blue")
                .warnPalette("blue-grey")
                .backgroundPalette("grey")
                .dark();

                $mdThemingProvider.setDefaultTheme('default');


                var states = [
                {
                    name: "default",
                    url: "/",
                    component: 'recipes'
                },
                {
                    name: "recipes",
                    url: "/recipes",
                    component: 'recipes'
                },
                {
                    name: "myRecipes",
                    url: "/my-recipes",
                    component: 'myRecipes'
                },
                {
                    name: "favorites",
                    url: "/favorites",
                    component: 'favorites'
                },
                {
                    name: "makeRecipe",
                    url: "/make-recipe",
                    component: 'makeRecipe'
                },
                {
                    name: "recipeDetails",
                    url: "/recipe-details/{id:int}",
                    component: 'recipeDetails'
                }];

                // Loop over the state definitions and register them
                states.forEach(function (state) {
                    $stateProvider.state(state);
                });

                $urlRouterProvider.otherwise('/');

                $compileProvider.aHrefSanitizationWhitelist(/^\s*(https?|ftp|mailto|file|tel):/);

                //$locationProvider.html5Mode({
                //    enabled: true,
                //    requireBase: false
                //});
                //$locationProvider.hashPrefix('');
            });

    app.value("$routerRootComponent", "recipeApp");

    app.service("recipesService", function ($http) {
        return {
            getRecipes: function () {
                return $http.get('data.json');
            } 
        };
    });

    app.service("styleService", function () {
        return {
            getBackground: function () {
                var img = "data:image/png;base64,";
                return {
                    'background': 'linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5)), url(' + img + ')',
                    'background-size': 'cover'
                };
            }
        };
    });

    app.controller("AppCtrl", function ($scope, $mdSidenav, $rootScope) {

        $scope.openRight = function () {
            if ($mdSidenav('left').isOpen()) {
                $mdSidenav('left').close();
            }
            else {
                $mdSidenav('right').open();
            }
        };

        $scope.openLeft = function () {
            if ($mdSidenav('right').isOpen()) {
                $mdSidenav('right').close();
            }
            else {
                $mdSidenav('left').open();
            }
        };

    });

})();


